// import '../App.css';
function NavBar(){
    return(
        <header>
            <h1>NavBar</h1>
            <nav>
                <ul className='navbar'>
                    <li className='nav-item'><a href=''>Home</a></li>
                    <li className='nav-item'><a href=''>About</a></li>
                    <li className='nav-item'><a href=''>Contact</a></li>
                    <li className='nav-item'><a href=''>Services</a></li>
                </ul>
            </nav>
        </header>
    )
}
export default NavBar;
